package main

import (
	"bytes"
	"encoding/base64"
	"fmt"
	"image/gif"
	"time"
)

// KusanagiGIFBase64 is the kusanagi_4x.gif animation encoded as base64
// This embeds the animation directly in the binary, eliminating external file dependencies
const KusanagiGIFBase64 = ""

// LoadGIFAnimationFromBytes loads a GIF from byte data and prepares it for animation
// This is used for embedded GIF animations that don't require file I/O
func LoadGIFAnimationFromBytes(gifData []byte, displayWidth int) (*PixelBlockAnimator, error) {
	reader := bytes.NewReader(gifData)
	g, err := gif.DecodeAll(reader)
	if err != nil {
		return nil, fmt.Errorf("failed to decode GIF: %v", err)
	}

	delays := make([]time.Duration, len(g.Delay))
	for i, d := range g.Delay {
		if d <= 0 {
			d = 10 // Default 100ms if not specified
		}
		delays[i] = time.Duration(d) * 10 * time.Millisecond
	}

	return &PixelBlockAnimator{
		frames: g.Image,
		delays: delays,
		width:  displayWidth,
	}, nil
}

// GetKusanagiGIFBytes decodes the embedded base64 kusanagi GIF and returns the binary data
func GetKusanagiGIFBytes() ([]byte, error) {
	decoder := base64.NewDecoder(base64.StdEncoding, bytes.NewReader([]byte(KusanagiGIFBase64)))
	buf := new(bytes.Buffer)
	_, err := buf.ReadFrom(decoder)
	if err != nil {
		return nil, fmt.Errorf("failed to decode kusanagi GIF: %v", err)
	}
	return buf.Bytes(), nil
}
